  `REMARKS` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `THE_ORDER` smallint(6) NOT NULL DEFAULT 1 COMMENT '排序号',
  `CHILD_NUM` smallint(6) NOT NULL DEFAULT 0 COMMENT '孩子节点数量',
  `IS_LEAF` bit(1) NOT NULL DEFAULT b'1' COMMENT '是否是叶子节点',
  `PARENT_ID` int(11) NOT NULL DEFAULT -1 COMMENT '父节点编号 默认 是 -1',
  `THE_LEVEL` smallint(6) NOT NULL DEFAULT 1 COMMENT '等级号',
